import React, { useState } from 'react';

export default function Agendamento() {
  const [form, setForm] = useState({ nome: '', email: '', telefone: '', servico: '', data: '' });

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    alert('Agendamento enviado com sucesso!');
  };

  return (
    <section>
      <h2>Agende sua consulta</h2>
      <form onSubmit={handleSubmit}>
        <input name="nome" placeholder="Nome" value={form.nome} onChange={handleChange} required />
        <input name="email" placeholder="Email" value={form.email} onChange={handleChange} required />
        <input name="telefone" placeholder="Telefone" value={form.telefone} onChange={handleChange} required />
        <input name="servico" placeholder="ServiÃ§o desejado" value={form.servico} onChange={handleChange} required />
        <input type="date" name="data" value={form.data} onChange={handleChange} required />
        <button type="submit">Enviar</button>
      </form>
    </section>
  );
}
